import {CardWrapper, MovieImg, MovieInfo, RankWrapper} from "./styles";

const BoxOfficeCard = ({ data }) => {
  const sliceAttendance = data.attendance.slice(3);

  return (
    <CardWrapper>
      <MovieImg>
        <img src={data.image} alt="boxoffice_image" />
        <RankWrapper>
          { data.rank }
        </RankWrapper>
      </MovieImg>
      <MovieInfo>
        <p>{ sliceAttendance }</p>
        <p>{ data.title }</p>
      </MovieInfo>
    </CardWrapper>
  );
};

export default BoxOfficeCard;
